def solver(corridor):
    corridor = corridor.strip("P")
    # count number of S: if odd, return 0
    memo = 0 
    for _ in corridor: 
        if _ == "S": 
            memo += 1 
    if memo < 2: 
        return 0
    if memo % 2 == 1: 
        return 0 
    def recur(i):
        if i == len(corridor): 
            return 1
        # find index containing first 2 "S"
        count = 0 
        ptr = i - 1  
        while count != 2: 
            ptr += 1 
            if corridor[ptr] == "S": 
                count += 1 
        ways = 0 
        if ptr + 1 == len(corridor) or corridor[ptr + 1] == "S": 
            ways = recur(ptr + 1)
            return ways 
        # find next S after ptr
        next_ptr = ptr + 1 
        while len(corridor) > next_ptr and corridor[next_ptr] != "S": 
            next_ptr += 1
        diff = next_ptr - ptr
        ways = diff * recur(next_ptr) 
        return ways 
    return recur(0) % (10**9 + 7)


        



